import {
  Alert,
  Image,
  Linking,
  Platform,
  ScrollView,
  StyleSheet,
  Text,
  TouchableOpacity,
  View,
} from 'react-native';
import Footer from '../components/Footer';
import Header from '../components/Header';

export default function HasilPositif({ route, navigation }) {
  const {
    nama = 'Nama Tidak Diketahui',
    probabilitas = 0.0,
    tanggal,
  } = route.params || {};

  const tanggalFormatted = tanggal
    ? new Date(tanggal).toLocaleDateString('id-ID', {
        day: '2-digit',
        month: 'long',
        year: 'numeric',
      })
    : '-';

  const showAlert = (message, title = 'Peringatan') => {
    if (Platform.OS === 'web') {
      alert(`${title}\n\n${message}`);
    } else {
      Alert.alert(title, message);
    }
  };

  const handleKembali = () => navigation.navigate('MainMenu');

  const handleHubungiKami = () => {
    const nomorWA = '6281274489306';
    const pesan =
      'Halo, saya ingin konsultasi mengenai hasil screening TBC saya.';
    const url = `https://wa.me/${nomorWA}?text=${encodeURIComponent(pesan)}`;

    Linking.openURL(url).catch((err) => {
      console.error('Gagal membuka WhatsApp', err);
      showAlert(
        'Gagal membuka WhatsApp. Pastikan Anda memiliki aplikasi WhatsApp.',
        'Error'
      );
    });
  };

  return (
    <View style={{ flex: 1, backgroundColor: '#fff' }}>
      <Header />

      <ScrollView
        contentContainerStyle={{ flexGrow: 1, justifyContent: 'space-between' }}
        style={{ flex: 1 }}
      >
        <View style={{ padding: 20, flex: 1, alignItems: 'center' }}>
          <Text style={styles.header}>SCREENING TBC</Text>
          <Text style={styles.subHeader}>
            Segera periksa diri Anda ke fasilitas kesehatan terdekat. TBC bisa disembuhkan!
          </Text>

          <View style={styles.card}>
            <Image
              source={require('../assets/images/Sakit.png')}
              style={styles.image}
              resizeMode="contain"
            />

            <View style={styles.identityBox}>
              <Text style={styles.name}>{nama}</Text>
              <Text style={styles.date}>{tanggalFormatted}</Text>
            </View>

            <Text style={styles.result}>Anda Terduga TBC</Text>
            <Text style={styles.prob}>
              Probabilitas: {(probabilitas * 100).toFixed(2)}%
            </Text>
          </View>

          <Text style={styles.footerNote}>
            Segera kunjungi Puskesmas atau fasilitas kesehatan terdekat untuk pemeriksaan lebih lanjut.
          </Text>

          <View style={styles.buttonGroup}>
            <TouchableOpacity style={[styles.button, styles.whatsapp]} onPress={handleHubungiKami}>
              <Text style={styles.buttonText}>Hubungi Kami</Text>
            </TouchableOpacity>
            <TouchableOpacity
              style={[styles.button, styles.secondaryButton]}
              onPress={handleKembali}
            >
              <Text style={styles.secondaryButtonText}>Kembali ke Halaman Awal</Text>
            </TouchableOpacity>
          </View>
        </View>

        <Footer />
      </ScrollView>
    </View>
  );
}

const styles = StyleSheet.create({
  header: {
    fontSize: 22,
    fontWeight: 'bold',
    color: '#c62828',
    textAlign: 'center',
    marginBottom: 10,
  },
  subHeader: {
    fontSize: 14,
    color: '#555',
    textAlign: 'center',
    marginBottom: 20,
    paddingHorizontal: 20,
  },
  card: {
    backgroundColor: '#ffebee',
    borderRadius: 12,
    padding: 20,
    alignItems: 'center',
    marginBottom: 20,
    width: '100%',
  },
  image: {
    width: 140,
    height: 140,
    marginBottom: 10,
  },
  identityBox: {
    alignItems: 'center',
    marginVertical: 10,
  },
  name: {
    fontSize: 18,
    fontWeight: 'bold',
    color: '#333',
  },
  date: {
    fontSize: 14,
    color: '#777',
  },
  result: {
    fontSize: 20,
    fontWeight: 'bold',
    color: '#b71c1c',
    marginTop: 10,
  },
  prob: {
    fontSize: 16,
    color: '#444',
    marginTop: 5,
  },
  footerNote: {
    fontSize: 14,
    color: '#555',
    textAlign: 'center',
    marginBottom: 20,
  },
  buttonGroup: {
    width: '100%',
    alignItems: 'center',
  },
  button: {
    padding: 14,
    borderRadius: 10,
    marginBottom: 15,
    width: '100%',
    alignItems: 'center',
  },
  whatsapp: {
    backgroundColor: '#25D366',
  },
  buttonText: {
    color: '#fff',
    fontWeight: 'bold',
    fontSize: 16,
  },
  secondaryButton: {
    backgroundColor: '#f1f1f1',
  },
  secondaryButtonText: {
    color: '#333',
    fontSize: 16,
    fontWeight: 'bold',
  },
});
